import React from 'react';

const TaskList = (props) => {
  // Responsable On Get The Data In The Form (( Get Request))
  const url =
    'https://second-demo-auth-post-get-default-rtdb.firebaseio.com/Task.json';

  const data = () => {
    fetch(url)
      .then((res) => res.json())
      .then((data) => {
        console.log(data);
      });
  };

  return (
    <>
      <section>
        <div>
          <h3>{props.taskDetails}</h3>
          <p> {props.taskDate}</p>
        </div>
        <button onClick={data}>Delete</button>
      </section>
    </>
  );
};

export default TaskList;
